import { Container, Typography } from "@mui/material";
import { makeStyles } from "@mui/styles";
import React from "react";
const useStyles = makeStyles({
  title: {
    marginTop: 10,
  },
});
const DataHolder = () => {
  const classes = useStyles();
  return (
    <React.Fragment>
      <Typography
        variant="h3"
        color="primary"
        component="h3"
        gutterBottom
        className={classes.title}
      >
        Todo DataHolder
      </Typography>
    </React.Fragment>
  );
};

export default DataHolder;
